import React from 'react';
import PropTypes from 'prop-types';
// import Dummy from '../ui/dummys/Dummy';
import Dummy from 'ui/dummys/Dummy';
import Button from 'ui/buttons/Button';
import Select from 'ui/select/Select';
import SVGDummy from 'ui/svg/Dummy';

/**
 * General component description in JSDoc format. Markdown is *supported*.
 */

var test =  '';

console.log( test );

const DummyBig = ( optionsState ) => (
    <div>
        DUMMYBIG
        <SVGDummy />
        <Dummy text="Calendar" />
        <Button text="button1" />
        <Button text="button2" />
        <Button text="button3" />
        <Button text="button4" />
        <select value={optionsState} readOnly>
            <option value="A">Apple</option>
            <option value="B">Banana</option>
            <option value="C">Cranberry</option>
        </select>
        <select value={optionsState} readOnly>
            <option value="A">Apple</option>
            <option value="B">Banana</option>
            <option value="C">Cranberry</option>
        </select>

    </div>


);


DummyBig.propTypes = {
    /** Description of prop "text". */
    text: PropTypes.string,
    optionsState: PropTypes.string
};

DummyBig.defaultProps = {
    text: 'defaultText'


};

export default DummyBig;
